import React from "react";
import { NavLink } from "react-router-dom";

function randomnum(min, max)
{
	let rand;
	let ret;

	rand = Math.random() * (max - min); /* now in range [0, max-min) */
	ret = rand + min; /* now in range [min, max) */
	ret = Math.floor(ret); /* now floored down */

	return ret;
}

function Layout(props)
{
	const nRandomLinks = 2;
	let randomLinks = [];
	for (let i = 0; i < nRandomLinks; i++) {
		let randomIdx = randomnum(0, props.links.random.length);
		let randomLink = props.links.random(randomIdx);
	}

	return (
		<nav className="navbar" >
			<span className="logo">
				<NavLink
				className="navlink"
				activeClassName="navlinkActive"
				to={ props.links.index }
				exact={ true }>
					Super-Mega Questions
				</NavLink>
			</span>
			<ul>
				<li>
					<NavLink
					className="navlink"
					activeClassName="navlinkActive"
					to={ props.links.create }
					exact={ true }>
						Create Question
					</NavLink>
				</li>
			</ul>
		</nav>
	);
}

export default Layout;
